import {
    Container,
    Form,
    FormGroup,
    Label,
    Input,
    Row,
    Col
  } from 'reactstrap/';

const FormUser = (props) => {

    const [input, setInput] = useState("");

    const save = e => {
        e.preventDefault();
        setInput(e.target.value);
    };

    return (
        <Container style={{position: 'absolute', left: '50%', top: '50%',transform: 'translate(-50%, -50%)'}}>
            <Row style={{display: 'flex', justifyContent: 'center'}}>
                <Col md="6">
                    <Form onSubmit={() => onSave()}>
                        <FormGroup>
                            <Input type="text" name="username" id="username" placeholder="@Username..." onChange={() => setInput(this)}/>
                        </FormGroup>
                    </Form>
                </Col>
            </Row>
            <Row style={{display: 'flex', justifyContent: 'center'}}>
                <h1>Colores</h1>
            </Row>
        </Container>
    );
}

export default FormUser;
